INSERT INTO `events` (`event_id`, `event_detail`, `event_name`, `event_address`, `event_image`, `event_price`, `event_date`, `event_ppl_allow`, `staff_id`) VALUES
(1000, 'The Watermedia Showcase awards original art created primarily with water-based media (watercolor, acrylic, casein, gouache, or egg tempera) on a surface created for watermedia. Judged by the editors of Watercolor Artist, all winners and honorable mentions will have their work featured in the magazine. The prize for winner is RM100 and RM50 for 2nd prize. This competition will be open to international artists 18 years of age and older. Here is your chance to win huge cash prize, but also the chance for your work to be published.', 'Watermedia Showcase', 'Ground Floor of art building', , 30, '2022-12-01 10:00:00', 200, NULL);
INSERT INTO `events` (`event_id`, `event_detail`, `event_name`, `event_address`, `event_image`, `event_price`, `event_date`, `event_ppl_allow`, `staff_id`) VALUES
(1001, 'This digital art competition is organized by Lumen Art Projects Ltd, a non-profit organization that’s dedicated to providing new opportunities for digital artists around the world. The contest guidelines are relatively loose—the only requirement is that the submitted artworks must somehow engage with technology. Categories include Still, Moving Image, XR, 3D/Interactive and Artificial Intelligence. The winner will get RM80 and RM50 for 2nd prize. This competition will be open to artists worldwide.', 'The Lumen For Digital Art', 'Ground Floor of art building', , 35, '2022-12-02 13:00:00', 200, NULL);
INSERT INTO `events` (`event_id`, `event_detail`, `event_name`, `event_address`, `event_image`, `event_price`, `event_date`, `event_ppl_allow`, `staff_id`) VALUES
(1002, 'Illustrators are invited to submit work created or published to 8 different categories. Winners will not only win a cash prize, but they’ll also be awarded invaluable global exposure, such as a marketing package in the Directory of Illustration, a feature in a major exhibition in central London, and an invitation to the Awards Evening in October. A cash prize of RM30 for the winner. This competition will be open to artists worldwide.', 'World Illustration', 'Ground Floor of art building', , 30, '2022-12-03 10:00:00', 200, NULL);
INSERT INTO `events` (`event_id`, `event_detail`, `event_name`, `event_address`, `event_image`, `event_price`, `event_date`, `event_ppl_allow`, `staff_id`) VALUES
(1003, 'The Strokes of Genius Competition celebrates original work made in drawing mediums; including pencil, charcoal, Conté crayon, pen and ink, scratchboard, silverpoint, colored pencil, pastel, and even some wet paint mediums if used in a linear or sketchy manner. Winning entries plus an additional 85+ finalists will be published in a special edition publication, from the editors of Artists Magazine. The winner will get RM50 and the RM20 for 2nd prize. This competition open to artists worldwide.', 'Strokes Of Genuis', 'Ground Floor of art building', , 30, '2022-12-05 10:00:00', NULL, NULL);
INSERT INTO `events` (`event_id`, `event_detail`, `event_name`, `event_address`, `event_image`, `event_price`, `event_date`, `event_ppl_allow`, `staff_id`) VALUES
(1004, 'Founded in 2017, is a creative haven where everyone can be a painter. This cosy art studio offers a safe space for people of all ages to focus on painting, drinking, and just having a fun time. The painting workshop is a fun activity for groups of friends, family, colleagues, or couples - you can even pair up and create a masterpiece on two canvases that can be pieced together to form a seamless artwork! Book your experience that comes inclusive of a canvas, all art tools, a glass of wine or orange juice, and free-flow coffee and tea.', 'Sip and Paint at Art & Bonding', 'Second Floor of art building', , 128, '2022-12-10 10:00:00', NULL, NULL);
INSERT INTO `events` (`event_id`, `event_detail`, `event_name`, `event_address`, `event_image`, `event_price`, `event_date`, `event_ppl_allow`, `staff_id`) VALUES
(1005, 'You\'ll likely have come across aesthetic and therapeutic videos of fluid art while scrolling through social media - this unique form of painting involves mixing acrylic paints and pouring them onto a canvas, creating abstract designs that turn into one-of-a-kind, incredible pieces of artwork. Try your hand at fluid pouring at Fluid Pouring Workshop, a fairly new artsy space located in Eko Cheras Mall! Come by with your besties or family for a few hours of fun.', 'Fluid Pouring Workshop', 'Second Floor of art building', , 150, '2022-12-10 08:00:00', NULL, NULL);
INSERT INTO `events` (`event_id`, `event_detail`, `event_name`, `event_address`, `event_image`, `event_price`, `event_date`, `event_ppl_allow`, `staff_id`) VALUES
(1006, 'The iconic Kuala Lumpur City Gallery is a Gold Award Winning Centre located in the heart of KL - it\'s known for its Malaysian-made arch models that used to be extremely popular souvenirs amongst tourists! Put yor hands to test by learning to create your very own Petronas Towers or Malaysian lantern arch model from scratch with an Arch Model Making workshop - the package comes inclusive of a delicious meal and free admission to the gallery.', 'Arch Model Making Workshop', 'Second Floor of art building', , 100, '2022-12-10 10:00:00', NULL, NULL);
INSERT INTO `events` (`event_id`, `event_detail`, `event_name`, `event_address`, `event_image`, `event_price`, `event_date`, `event_ppl_allow`, `staff_id`) VALUES
(1008, 'We bet you\'ve seen this bright studio with colourful rugs all over Instagram! Rug tufting is a pretty new trend in Malaysia, and Tuftme is a sparkling new tufting studio in town. Learn to make your own bespoke, fluffy rug by taking your pick from a range of cute designs or customize your very own! You can place your rug tufting workshop booking by dropping them a DM on Instagram - while the workshop is pricier than others on this list, it\'s great for those looking for a novelty experience that\'s hard to find elsewhere.', 'Rug Tufting Workshop', 'Second Floor of art building', , 0, '2022-12-10 08:00:00', NULL, NULL);
INSERT INTO `events` (`event_id`, `event_detail`, `event_name`, `event_address`, `event_image`, `event_price`, `event_date`, `event_ppl_allow`, `staff_id`) VALUES
(1009, 'Lostgens in Kuala Lumpur will be hosting an art talk by Maike Häusling. This will be quite an interesting event which will feature the dialogue with the German multimedia artist who has made a name for herself using digital media through integration with painting and other artists. This is where she will be talking about her temporary art works placed at public locations.', 'Art Talk By Maike Häusling', 'Second Floor of art building', , 0, '2022-12-15 08:00:00', 250, NULL);
